#China #COVID rules adjustment:
*Shorten quarantine requirement for close contacts to 8 days vs 10 days before (5+3 vs 7+3);
*Will identify close contacts only, and no longer identify close contacts of close contacts;
*Cancel circuit breaker mechanism for inbound flights;
